    pub const HEIGHT: u8 = 30;

    pub const WIDTH_PLUS_SPACE: u8 = WIDTH + X_EMPTY_SPACE + X_EMPTY_SPACE;
    pub const HEIGHT_PLUS_SPACE: u8 = HEIGHT + Y_EMPTY_SPACE + Y_EMPTY_SPACE;

    pub const FRONT_SPRITE_X: u8 = 2;
